document.addEventListener("DOMContentLoaded", () => {
    const movieList = document.getElementById("movie-list");
    const movieTitle = document.getElementById("movie-title");
    const movieDescription = document.getElementById("movie-description");
    const moviePoster = document.getElementById("movie-poster");
    const movieRuntime = document.getElementById("movie-runtime");
    const movieShowtime = document.getElementById("movie-showtime");
    const ticketsLeft = document.getElementById("tickets-left");
    const buyTicketBtn = document.getElementById("buy-ticket");

    let movies = [
        {
            id: 1,
            title: "The electric state",
            runtime: 165,
            showtime: "04:00 PM",
            description: "Robot life in the wild west.",
            poster: "https://dnm.nflximg.net/api/v6/2DuQlx0fM4wd1nzqm5BFBi6ILa8/AAAAQVquUgzDq7J_Q-QKhrVn2GXkTlq59fsBCvLZ2JP1PMKxbRDGuqpHiggQQSGca5FcVohyTcJgjz_UrIxICCenLytxGxFIs-e0dKqrjVgT0ovS9A6rWO8UkcZBrjPOxYjylf65Ge2iqlXAQ5kegE2cFr9d.jpg?r=1dd",
            tickets: 3
        },
        {
            id: 2,
            title: "Black bag",
            runtime: 90,
            showtime: "06:30 PM",
            description: "It takes a spy to hunt one.",
            poster: "https://i.ytimg.com/vi/Du0Xp8WX_7I/maxresdefault.jpg",
            tickets: 5
        },
        {
            id: 1,
            title: "Novocaine",
            runtime: 125,
            showtime: "06:30 PM",
            description: "The man who feels no pain.",
            poster: "data:image/jpeg;base64,",
            tickets: 5
        },
        {
            id: 1,
            title: "Snow White",
            runtime: 234,
            showtime: "06:30 PM",
            description: "A princess faces hardship.",
            poster: "data:image/jpeg;base64,",
            tickets: 5
        },
        {
            id: 1,
            title: "Trap",
            runtime: 145,
            showtime: "06:30 PM",
            description: "Appreciate the tongue in cheek style",
            poster: "data:image/jpeg;base64,",
            tickets: 5
        },
        {
            id: 1,
            title: "Moana 2",
            runtime: 154,
            showtime: "06:30 PM",
            description: "Moana journeys to the far seas of Oceania after receiving an unexpected call from her wayfinding ancestors.",
            poster: "data:image/jpeg;base64,",
            tickets: 5
        }
    ];

    function loadMovies() {
        movies.forEach(movie => {
            let li = document.createElement("li");
            li.textContent = movie.title;
            li.addEventListener("click", () => displayMovie(movie));
            movieList.appendChild(li);
        });
    }

    //displaying a movie
    function displayMovie(movie) {
        movieTitle.textContent = movie.title;
        movieDescription.textContent = movie.description;
        moviePoster.src = movie.poster;
        movieRuntime.textContent = movie.runtime;
        movieShowtime.textContent = movie.showtime;
        ticketsLeft.textContent = movie.tickets > 0 ? `${movie.tickets} remaining tickets` : "Sold Out";
        
        ticketsLeft.textContent=movie.tickets>0?
        buyTicketBtn.disabled = movie.tickets === 0 `${movie.tickets} remaining tickets` : "Sold Out";
        
        
        buyTicketBtn.onclick = () => buyTicket(movie);
    }
    document.getElementById("buy-ticket").addEventListener("click", buyTicket);
//buying tickets
        function buyTicket() {
            let movie = movies.find(m => m.title === document.getElementById("movie-title").textContent);
        
            if (movie && movie.tickets > 0) {
                movie.tickets--;
                document.getElementById("tickets-left").textContent = `${movie.tickets} remaining tickets`;
        
                if (movie.tickets === 0) {
                    document.getElementById("buy-ticket").textContent = "Sold Out";
                    document.getElementById("buy-ticket").disabled = true;
                }
            }
        }
        

    loadMovies();
});
